        public AXLAPIService(string server, string user, string password)
        {
            System.Net.ServicePointManager.CertificatePolicy = new BruteForcePolicy();
            string urlSetting = server;
            string userSetting = user;
            string passwordSetting = password;
            if ((urlSetting != null))
            {
                this.Url = urlSetting;
            }
            else
            {
                this.Url = "https://CCMSERVERNAME:8443/axl/";
            }
            this.Credentials = new System.Net.NetworkCredential(userSetting, passwordSetting);
        }

